create table QRTZ_BLOB_TRIGGERS
(
    sched_name    varchar(120) not null,
    trigger_name  varchar(200) not null,
    trigger_group varchar(200) not null,
    blob_data     blob         null,
    primary key (sched_name, trigger_name, trigger_group),
    constraint QRTZ_BLOB_TRIGGERS_ibfk_1
        foreign key (sched_name, trigger_name, trigger_group) references QRTZ_TRIGGERS (sched_name, trigger_name, trigger_group)
)
    charset = utf8;


create table QRTZ_CALENDARS
(
    sched_name    varchar(120) not null,
    calendar_name varchar(200) not null,
    calendar      blob         not null,
    primary key (sched_name, calendar_name)
)
    charset = utf8;


create table QRTZ_CRON_TRIGGERS
(
    sched_name      varchar(120) not null,
    trigger_name    varchar(200) not null,
    trigger_group   varchar(200) not null,
    cron_expression varchar(200) not null,
    time_zone_id    varchar(80)  null,
    primary key (sched_name, trigger_name, trigger_group),
    constraint QRTZ_CRON_TRIGGERS_ibfk_1
        foreign key (sched_name, trigger_name, trigger_group) references QRTZ_TRIGGERS (sched_name, trigger_name, trigger_group)
)
    charset = utf8;

create table QRTZ_FIRED_TRIGGERS
(
    sched_name        varchar(120) not null,
    entry_id          varchar(95)  not null,
    trigger_name      varchar(200) not null,
    trigger_group     varchar(200) not null,
    instance_name     varchar(200) not null,
    fired_time        bigint       not null,
    sched_time        bigint       not null,
    priority          int          not null,
    state             varchar(16)  not null,
    job_name          varchar(200) null,
    job_group         varchar(200) null,
    is_nonconcurrent  varchar(1)   null,
    requests_recovery varchar(1)   null,
    primary key (sched_name, entry_id)
)
    charset = utf8;


create table QRTZ_JOB_DETAILS
(
    sched_name        varchar(120) not null,
    job_name          varchar(200) not null,
    job_group         varchar(200) not null,
    description       varchar(250) null,
    job_class_name    varchar(250) not null,
    is_durable        varchar(1)   not null,
    is_nonconcurrent  varchar(1)   not null,
    is_update_data    varchar(1)   not null,
    requests_recovery varchar(1)   not null,
    job_data          blob         null,
    primary key (sched_name, job_name, job_group)
)
    charset = utf8;

create table QRTZ_LOCKS
(
    sched_name varchar(120) not null,
    lock_name  varchar(40)  not null,
    primary key (sched_name, lock_name)
)
    charset = utf8;

create table QRTZ_PAUSED_TRIGGER_GRPS
(
    sched_name    varchar(120) not null,
    trigger_group varchar(200) not null,
    primary key (sched_name, trigger_group)
)
    charset = utf8;


create table QRTZ_SCHEDULER_STATE
(
    sched_name        varchar(120) not null,
    instance_name     varchar(200) not null,
    last_checkin_time bigint       not null,
    checkin_interval  bigint       not null,
    primary key (sched_name, instance_name)
)
    charset = utf8;

create table QRTZ_SIMPLE_TRIGGERS
(
    sched_name      varchar(120) not null,
    trigger_name    varchar(200) not null,
    trigger_group   varchar(200) not null,
    repeat_count    bigint       not null,
    repeat_interval bigint       not null,
    times_triggered bigint       not null,
    primary key (sched_name, trigger_name, trigger_group),
    constraint QRTZ_SIMPLE_TRIGGERS_ibfk_1
        foreign key (sched_name, trigger_name, trigger_group) references QRTZ_TRIGGERS (sched_name, trigger_name, trigger_group)
)
    charset = utf8;


create table QRTZ_SIMPROP_TRIGGERS
(
    sched_name    varchar(120)   not null,
    trigger_name  varchar(200)   not null,
    trigger_group varchar(200)   not null,
    str_prop_1    varchar(512)   null,
    str_prop_2    varchar(512)   null,
    str_prop_3    varchar(512)   null,
    int_prop_1    int            null,
    int_prop_2    int            null,
    long_prop_1   bigint         null,
    long_prop_2   bigint         null,
    dec_prop_1    decimal(13, 4) null,
    dec_prop_2    decimal(13, 4) null,
    bool_prop_1   varchar(1)     null,
    bool_prop_2   varchar(1)     null,
    primary key (sched_name, trigger_name, trigger_group),
    constraint QRTZ_SIMPROP_TRIGGERS_ibfk_1
        foreign key (sched_name, trigger_name, trigger_group) references QRTZ_TRIGGERS (sched_name, trigger_name, trigger_group)
)
    charset = utf8;


create table QRTZ_TRIGGERS
(
    sched_name     varchar(120) not null,
    trigger_name   varchar(200) not null,
    trigger_group  varchar(200) not null,
    job_name       varchar(200) not null,
    job_group      varchar(200) not null,
    description    varchar(250) null,
    next_fire_time bigint       null,
    prev_fire_time bigint       null,
    priority       int          null,
    trigger_state  varchar(16)  not null,
    trigger_type   varchar(8)   not null,
    start_time     bigint       not null,
    end_time       bigint       null,
    calendar_name  varchar(200) null,
    misfire_instr  smallint     null,
    job_data       blob         null,
    primary key (sched_name, trigger_name, trigger_group),
    constraint QRTZ_TRIGGERS_ibfk_1
        foreign key (sched_name, job_name, job_group) references QRTZ_JOB_DETAILS (sched_name, job_name, job_group)
)
    charset = utf8;

create index sched_name
    on QRTZ_TRIGGERS (sched_name, job_name, job_group);

create table mdc_feedback
(
    id          int auto_increment comment '主键'
        primary key,
    message     varchar(255) null comment '内容',
    create_by   varchar(20)  null comment '创建人',
    create_time datetime     null comment '创建时间'
);


create table mdc_income
(
    id                int auto_increment comment '主键'
        primary key,
    user_id           int                           null comment '用户id',
    contract_salary   decimal(12, 4) default 0.0000 null comment '静态收益',
    share_salary      decimal(12, 4) default 0.0000 null comment '分享收益',
    manage_salary     decimal(12, 4) default 0.0000 null comment '管理收益',
    salary            decimal(12, 4) default 0.0000 null comment '最终收益',
    contract_id       int                           null comment '收益合约id',
    type              tinyint                       null comment '类型 1签约收益 2进阶收益',
    remark            varchar(255)                  null comment '备注',
    amount            decimal(12, 4)                null comment '本金',
    rate              decimal(12, 4)                null comment '利率',
    sel_date          datetime                      null comment '结算日期',
    create_by         varchar(20)                   null comment '创建人',
    create_time       datetime(6)                   null comment '创建时间',
    number            tinyint                       null comment '进阶卡数量',
    unit              varchar(20)                   null comment '单位',
    is_cal_msalary    tinyint        default 0      null comment '是否计算过管理收益',
    same_level_salary decimal(12, 4) default 0.0000 null comment '平级收益'
);

create table mdc_transaction
(
    transaction_id      int auto_increment comment '交易id'
        primary key,
    from_user_id        int            null comment '支出用户id',
    from_wallet_address varchar(255)   null comment '支出钱包地址',
    to_user_id          int            null comment '收取用户id',
    to_wallet_address   varchar(255)   null comment '收取钱包id',
    create_time         datetime       null comment '交易时间',
    remark              text           null comment '交易说明',
    from_amount         decimal(12, 4) null comment '支出金额',
    from_wallet_type    char           null comment '支出钱包类型（0-ustd,1-mdc,2-vas,3-eth）',
    to_amount           decimal(12, 4) null comment '收取金额',
    to_wallet_type      char           null comment '收取钱包类型（0-ustd,1-mdc,2-vas,3-eth）',
    transaction_type    char           null comment '交易类型（2-转账 4-购买合约 5-购买进阶卡 6-每日收益结算 7-mdc兑换usdt 8-扣费）',
    fee_amount          decimal(12, 4) null comment '手续费',
    transaction_status  char(2)        null comment '交易状态（-2：审核不通过 -1：交易失败 0：待交易 1：交易完成）',
    transaction_hash    varchar(255)   null comment '交易hash
',
    contract_type       char(2)        null comment '0-购买 1-升级 -1-解约'
);

