    comment '字典类型表' charset = utf8;

create table sys_job
(
    job_id          int auto_increment comment '任务ID',
    job_name        varchar(64)  default ''  not null comment '任务名称',
    job_group       varchar(64)  default ''  not null comment '任务组名',
    method_name     varchar(500) default ''  null comment '任务方法',
    method_params   varchar(50)              null comment '方法参数',
