create table sys_params
(
    id         varchar(36)  not null
        primary key,
    status     char         null,
    deleted    int          null,
    createtime datetime     null,
    updatetime datetime     null,
    name       varchar(255) null comment '参数名称',
    key_name   varchar(255) null comment '参数键名',
    key_value  varchar(255) null comment '键值',
    remark     text         null
)
    comment '系统参数';


create table sys_post
(
    post_id     int auto_increment comment '岗位ID'
        primary key,
    post_code   varchar(64)            not null comment '岗位编码',
    post_name   varchar(50)            not null comment '岗位名称',
    post_sort   int                    not null comment '显示顺序',
    status      char                   not null comment '状态（0正常 1停用）',
    create_by   varchar(64) default '' null comment '创建者',
    create_time datetime               null comment '创建时间',
    update_by   varchar(64) default '' null comment '更新者',
    update_time datetime               null comment '更新时间',
    remark      varchar(500)           null comment '备注'
)
    comment '岗位信息表' charset = utf8;

create table sys_role
(
    role_id     int auto_increment comment '角色ID'
        primary key,
    role_name   varchar(30)             not null comment '角色名称',
    role_key    varchar(100)            not null comment '角色权限字符串',
    role_sort   int                     not null comment '显示顺序',
    data_scope  char        default '1' null comment '数据范围（1：全部数据权限 2：自定数据权限）',
    status      char                    not null comment '角色状态（0正常 1停用）',
    del_flag    char        default '0' null comment '删除标志（0代表存在 2代表删除）',
    create_by   varchar(64) default ''  null comment '创建者',
    create_time datetime                null comment '创建时间',
    update_by   varchar(64) default ''  null comment '更新者',
    update_time datetime                null comment '更新时间',
    remark      varchar(500)            null comment '备注'
)
    comment '角色信息表' charset = utf8;

create table sys_role_dept
(
    role_id int not null comment '角色ID',
    dept_id int not null comment '部门ID',
    primary key (role_id, dept_id)
)
    comment '角色和部门关联表' charset = utf8;


create table sys_role_menu
(
    role_id int not null comment '角色ID',
    menu_id int not null comment '菜单ID',
    primary key (role_id, menu_id)
)
    comment '角色和菜单关联表' charset = utf8;

create table sys_user
(
    user_id                   int auto_increment comment '用户ID'
        primary key,
    dept_id                   int                           null comment '部门ID',
    login_name                varchar(30)                   not null comment '登录账号',
    user_name                 varchar(30)                   not null comment '用户昵称',
    user_type                 varchar(2)     default '00'   null comment '用户类型（00系统用户）',
    email                     varchar(50)    default ''     null comment '用户邮箱',
    phonenumber               varchar(11)    default ''     null comment '手机号码',
    sex                       char           default '0'    null comment '用户性别（0男 1女 2未知）',
    avatar                    varchar(100)   default ''     null comment '头像路径',
    password                  varchar(50)    default ''     null comment '密码',
    pay_password              varchar(50)                   null comment '支付密码',
    salt                      varchar(20)    default ''     null comment '盐加密',
    status                    char           default '0'    null comment '帐号状态（0正常 1停用）',
    del_flag                  char           default '0'    null comment '删除标志（0代表存在 2代表删除）',
    login_ip                  varchar(50)    default ''     null comment '最后登陆IP',
    login_date                datetime                      null comment '最后登陆时间',
    create_by                 varchar(64)    default ''     null comment '创建者',
    create_time               datetime                      null comment '创建时间',
    update_by                 varchar(64)    default ''     null comment '更新者',
    update_time               datetime                      null comment '更新时间',
    remark                    varchar(500)   default ''     null comment '备注',
    up_user_id                int                           null comment '推荐人id',
    level                     tinyint        default 0      null comment '等级 0无牌 1铜牌 2银牌 3金牌 4王牌',
    send_code                 int                           null comment '推广码
',
    gesture_switch            tinyint        default 0      null comment '手势密码 0关 1开',
    up_user_ids               text                          null comment '所有推荐人id',
    sign_contract_sum         decimal(12, 4) default 0.0000 null comment '签约合约收益总额',
    advance_contract_sum      decimal(12, 4) default 0.0000 null comment '进阶合约收益总额',
    union_sign_total_money    decimal(12, 4) default 0.0000 null comment '工会签约合约总额',
    union_advance_total_money decimal(12, 4) default 0.0000 null comment '工会进阶合约总额',
    self_sign_total_money     decimal(12, 4) default 0.0000 null comment '用户个人签约总额',
    self_advance_total_money  decimal(12, 4) default 0.0000 null comment '用户个人进阶总额',
    member_size               int            default 1      null comment '成员规模',
    register_type             tinyint                       null comment '注册类型  0：email 1：手机',
    constraint sys_user_login_name_uindex
        unique (login_name)
)
    comment '用户信息表' charset = utf8;

create table sys_user_level
(
    id          int auto_increment comment '主键'
        primary key,
    rec_id      int         null comment '推荐人id',
    reced_id    int         null comment '被推荐人id',
    level       tinyint     null comment '被推荐人相对于推荐人的层级',
    create_by   varchar(50) null comment '创建人',
    create_time datetime(6) null comment '创建时间'
);

create index rec_id
    on sys_user_level (rec_id);

create index reced_id
    on sys_user_level (reced_id);

create table sys_user_online
(
    sessionId        varchar(50)  default '' not null comment '用户会话id'
        primary key,
    login_name       varchar(50)  default '' null comment '登录账号',
    dept_name        varchar(50)  default '' null comment '部门名称',
    ipaddr           varchar(50)  default '' null comment '登录IP地址',
    login_location   varchar(255) default '' null comment '登录地点',
    browser          varchar(50)  default '' null comment '浏览器类型',
    os               varchar(50)  default '' null comment '操作系统',
    status           varchar(10)  default '' null comment '在线状态on_line在线off_line离线',
    start_timestamp  datetime                null comment 'session创建时间',
    last_access_time datetime                null comment 'session最后访问时间',
    expire_time      int          default 0  null comment '超时时间，单位为分钟'
)
    comment '在线用户记录' charset = utf8;

create table sys_user_post
(
    user_id int not null comment '用户ID',
    post_id int not null comment '岗位ID',
    primary key (user_id, post_id)
)
    comment '用户与岗位关联表' charset = utf8;

create table sys_user_role
(
    user_id int not null comment '用户ID',
    role_id int not null comment '角色ID',
    primary key (user_id, role_id)
)
    comment '用户和角色关联表' charset = utf8;

create table sys_user_tokens
(
    id       int auto_increment comment '主键'
        primary key,
    user_id  int          null comment '用户id',
    token    varchar(255) null comment 'token串',
    end_time datetime     null comment 'token失效时间'
);

create table sys_verification_code
(
    id          int auto_increment comment '主键'
        primary key,
    code        varchar(10) null comment '验证码',
    create_time datetime    null comment '创建时间',
    create_by   varchar(20) null comment '创建人'
);

create table vas_wallet
(
    id      int auto_increment
        primary key,
    address varchar(100) not null,
    balance double       not null,
    path    varchar(50)  null,
    user_id int          not null,
    pubkey  varchar(150) null,
    privkey varchar(159) null
)
    comment 'vas钱包表';

